import React from "react";
import Banner from "../../banner/Banner";
import Products from "../../products/Products";
import Footer from "../../footer/Footer";

function Home({ data }) {
  return (
    <div>
      <Banner />
      <Products title="Arzon narhlar" data={data} />
      <Footer />
    </div>
  );
}

export default Home;
